pragma solidity >= 0.5.0 < 0.6.0;

import "./provableAPI.sol";

contract UrlRequests is usingProvable {

    uint public dieselPriceUSD;

    event LogNewDieselPrice(string price);
    event LogNewProvableQuery(string description);

    mapping (bytes32 => bool) public pendingQueries;

    constructor()
    public
    {
        //OAR = OraclizeAddrResolverI(0x6dEa17F26aB56f5FbA2A17090B3BF0113ebEA0D8);        //update(); // First check at contract creation...
    }

    function __callback(
        bytes32 _myid,
        string memory result
    )
    public
    {
        require(msg.sender == provable_cbAddress());
        require (pendingQueries[_myid] == true);

        emit LogNewDieselPrice(result);
        dieselPriceUSD = parseInt(result, 2); // Let's save it as cents...
        // Now do something with the USD Diesel price...

        delete pendingQueries[_myid]; // This effectively marks the query id as processed.

    }

    function update()
    public
    payable
    {
        if (provable_getPrice("URL") > msg.value) {
            revert("Provable query was NOT sent, please add some ETH to cover for the query fee!");
        } else {
            emit LogNewProvableQuery("Provable query was sent, standing by for the answer...");
            bytes32 queryId = provable_query("URL", "xml(https://www.fueleconomy.gov/ws/rest/fuelprices).fuelPrices.diesel");

            pendingQueries[queryId] = true;
        }
    }
}
